import React from "react";
import * as FaIcons from "react-icons/fa";
import * as AiIcons from "react-icons/ai";
import * as IoIcons from "react-icons/io";

export const SideBarData = [
  {
    title: "Landing",
    path: "/",
    icon: AiIcons.AiFillHome,  // ✅
    cName: "nav-text",
  },
  {
    title: "Login",
    path: "/Login",
    icon: AiIcons.AiFillHome,
    cName: "nav-text",
  },
  {
    title: "Register",
    path: "/Register",
    icon: AiIcons.AiFillHome,
    cName: "nav-text",
  },
  {
    title: "Profile",
    path: "/Profile",
    icon: AiIcons.AiFillHome,
    cName: "nav-text",
  },
];
